import React from 'react';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from 'react-bootstrap/Card';
import '../components/styles/ListadoFotos.css';


function ListadoFotos(){

    return(
   
         <Row sytle={{widht:"100%"}}> 
             <Col md={4} lg={3} xs={12}>
             <Card>
             <Card.Img variant="top" src="https://cdn.pixabay.com/photo/2015/04/23/21/59/tree-736875__340.jpg" />
                 <Card.Body>
                 <Card.Text className="mt-0 mb-0">
      Some quick example text to build on
    </Card.Text>

                 </Card.Body>
             </Card>
             </Col>
         </Row>
       
    );
}

export default ListadoFotos;
